import "./App.css";

function App() {
  function test() {
    async function fetchData() {
      const response = await fetch("http://localhost:3000/forsinkelser").then((response) => {
        console.log(response);
      });
      const data = response;
      console.log(data);
    }
    fetchData();
  }
  return (
    <div className="App">
      <button onClick={test()}>TEST</button>
    </div>
  );
}

export default App;
